@SciencePundit @zimmerdiamonds @pgliljedahl @Mathowitz @Mathgarden @dexterlearning I ask “What is the largest number you can’t get with unlimited darts and a dart board with 9 and 4?”

And off they go to their groups to work on #vnps 

I manage the flow of the room and when a group has the answer. I offer another dartboard. 7/n

@SciencePundit @zimmerdiamonds @pgliljedahl @Mathowitz @Mathgarden @dexterlearning Then I say we are going to play a game. Then I ask for volunteer.
I draw the dartboard 🎯 on the whiteboard. It has two possibilities a 9 in the middle and a 4.
I go first-beagling on every dart-even throw the last (imaginary) dart behind the back. I get a 4,4,9 and a miss 3/n https://t.co/jztAJKnXOk

@SciencePundit @zimmerdiamonds @pgliljedahl @Mathowitz @Mathgarden @dexterlearning First I huddle them up-get everyone standing around a whiteboard near me.
Anybody play darts? Anybody watch darts?
Go into story of watching on TV-how much fun spectators have. They play 501. Talk about setup of a dartboard-really just storytelling and showing my personality.2/n

