@johnberray @pgliljedahl Actually 4 tasks-9 groups of 3 / TaskA groups1&amp;5&amp;9 Task B grps2&amp;6 TaskC3&amp;7 Task D4&amp;8

In Group part they collaborate&amp;set up a problem and differentiate it and simplify that derivative

In Individual part they get extensions / questions based on the problem they collaborated on

